    "# 1.0 reading the data using (fs) package\n",
    "df_read <- \"/kaggle/input/cyclistic-bike-share\"\n",
    "\n",
    "df <- df_read %>%\n",
    "  dir_ls() %>%\n",
    "  map(\n",
    "    .f = function(path) {\n",
    "      read_csv(\n",
    "        path\n",
    "        \n",
    "      )\n",
