   "source": [
    "#  HANDELING OUTLIERS\n",
    "Q <- quantile(df_all_c$duration_min, probs=c(.10, .90), na.rm = FALSE)\n",
    "iqr <- IQR(df_all_c$duration_min)\n",
    "up <-  Q[2]+1.5*iqr # Upper Range  \n",
    "low<- Q[1]-1.5*iqr # Lower Range\n",
    "df_all_o <- subset(df_all_c, df_all_c$duration_min > (Q[1] - 1.5*iqr) & df_all_c$duration_min < (Q[2]+1.5*iqr))\n",
    "\n",
    "df_all_r <- df_all_o %>% \n",
    "  filter( !duration_min <= 0)\n",
    "\n",
    "# check the data after handeling the outliers \n",
    "diagnose_outlier(df_all_r) \n",
    "\n",
    "df_all_r %>% \n",
    "  group_by(member_casual) %>% \n",
    "  select(duration_min) %>% \n",
    "  plot_outlier()\n",
    "\n",
    "dim(df_all_r)"
   ]
