   "source": [
    "# Remove Missing Data at random (MAR)\n",
    "## check the percentage of data with NA`s for both member and casual\n",
    "\n",
    "df_all_r %>% \n",
    "  count(member_casual) %>% \n",
    "  mutate(percent = n/nrow(df_all_r),\n",
    "         percent_label = paste0(round(percent * 100), \"%\")) %>%\n",
    "  ggplot(aes(\"\", percent, fill = member_casual, label = percent_label)) +\n",
    "  geom_col(color = \"white\", alpha = 0.7) +\n",
    "  geom_text(color = \"black\",\n",
    "            position = position_stack(vjust = 0.5),\n",
    "            size = 7) +\n",
    "  coord_polar(theta = \"y\", start = 0) +\n",
    "  theme_void() +\n",
    "  guides(fill = guide_legend(reverse = TRUE)) +\n",
    "  scale_fill_manual(values = c(\"#FFFF41\",\"#FF0018\")) +\n",
    "  labs(fill = \"User Type\" ,\n",
    "       title = \"Percentage of All Data by User Type\") +\n",
    "  theme(plot.title = element_text(hjust = 0.5,size = 18, color = \"black\"))"
   ]
  },
