   "source": [
    "# check the % of the ride_type\n",
    "theme_set(theme_bw())\n",
    "\n",
    "df_clean %>% \n",
    "  count(rideable_type) %>% \n",
    "  mutate(percent = n/nrow(df_clean),\n",
    "         percent_label = paste0(round(percent * 100), \"%\")) %>%\n",
    "  ggplot(aes(\"\", percent, fill = rideable_type, label = percent_label)) +\n",
    "  geom_col(color = \"white\") +\n",
    "  geom_text(color = \"black\",\n",
    "            position = position_stack(vjust = 0.5),\n",
    "            size = 7) +\n",
    "  coord_polar(theta = \"y\", start = 0) +\n",
    "  theme_void() +\n",
    "  guides(fill = guide_legend(reverse = TRUE)) +\n",
    "  scale_fill_manual(values = c(\"#EA4335\",\"#34A853\",\"#FBBC05\")) +\n",
    "  labs(fill = \"Bike Type\" ,\n",
    "       title = \"Percentage of Bike Type\") +\n",
    "  theme(plot.title = element_text(hjust = 0.5,size = 18, color = \"black\"))"
   ]
  },
