   "source": [
    "# the count of ride_type by user_type\n",
    "df_clean %>% \n",
    "  group_by(rideable_type) %>% \n",
    "  count(member_casual) %>% \n",
    "  ggplot(aes(x = fct_reorder(rideable_type,-n), y = n ,\n",
    "             fill =rideable_type)) +\n",
    "  geom_col(just = 0.5,width = 0.6)+\n",
    "  theme_bw()+\n",
    "  facet_wrap(~ member_casual)+\n",
    "  scale_fill_manual(values = c(\"#A07855FF\",\"#616247FF\",\"#FBBC05\")) +\n",
    "  scale_x_discrete(breaks=c(\"classic_bike\" , \"electric_bike\", \"docked_bike\"),\n",
    "                   labels = c(\"classic\\nbike\",\n",
    "                              \"electric\\nbike\",\n",
    "                              \"docked\\nbike\")) +\n",
    "  scale_y_continuous(labels = function(x)paste0(x/100000,\"M\"))+\n",
    "  theme(text = element_text(size = 16)) +\n",
    "    theme(strip.background =element_rect(fill=\"black\"))+\n",
    "    theme(strip.text = element_text(colour = 'white', size = 16,face = \"bold\")) +\n",
    "    labs(title = \"Ride Type by User Type\",\n",
    "         y = \"\",\n",
    "         x = \"\")+\n",
    "  theme(legend.position = \"none\")+\n",
    "   theme(plot.title = element_text(size = 18,\n",
    "                                  face = \"bold\",\n",
    "                                  color = \"black\",\n",
    "                                  hjust = 0),\n",
    "        axis.text = element_text(size = 12,\n",
    "                                 color = \"black\",\n",
    "                                 face = \"bold\"))"
   ]
