   "source": [
    "#  the count of Ride Type by User Type thru Weekdays\n",
    "df_clean %>% \n",
    "  group_by(rideable_type, wday) %>% \n",
    "  count(member_casual) %>% \n",
    "  ggplot(aes(x = wday, y = n ,\n",
    "             fill =rideable_type)) +\n",
    "  geom_col(just = 0.5,width = 0.6, position = \"dodge\")+\n",
    "  theme_bw()+\n",
    "  scale_y_continuous(labels = function(x)paste0(x/1000,\"K\"))+\n",
    "  facet_wrap(~ member_casual)+\n",
    "  theme(text = element_text(size = 16)) +\n",
    "    theme(strip.background =element_rect(fill=\"black\"))+\n",
    "    theme(strip.text = element_text(colour = 'white', size = 16,face = \"bold\")) +\n",
    "  scale_fill_manual(values = c(\"#A07855FF\",\"#616247FF\",\"#FBBC05\")) +\n",
    "    labs(title = \"Ride Type by User Type thru Weekdays\",\n",
    "         y = \"\",\n",
    "         x = \"\",\n",
    "         fill = \"Bike Type\")+\n",
    "   theme(plot.title = element_text(size = 18,\n",
    "                                  face = \"bold\",\n",
    "                                  color = \"black\",\n",
    "                                  hjust = 0),\n",
    "        axis.text = element_text(size = 12,\n",
    "                                 color = \"black\",\n",
    "                                 face = \"bold\"))"
   ]
