   "source": [
    "# Average Ride Per Minute by User Type\n",
    "df_clean %>% \n",
    "  group_by(member_casual) %>% \n",
    "  summarise(avg = mean(duration_min)) %>% \n",
    "  ggplot(aes(x = member_casual , y = avg, fill = member_casual)) +\n",
    "  geom_col(just = 0.5,width = 0.3) +\n",
    "   theme_bw() +\n",
    "  theme(legend.position = c(0.85,0.85))+\n",
    "  scale_fill_manual(values = c(\"#A07855FF\",\"#FBBC05\")) +\n",
    "  theme(text = element_text(size = 16)) +\n",
    "  theme(text = element_text(color = \"black\")) +\n",
    "  theme(axis.text = element_text(size = 12,\n",
    "                                 color = \"black\",\n",
    "                                 face = \"bold\"))+\n",
    "  theme(strip.text = element_text(colour = \"white\"))+\n",
    "  labs(title = \"Average Ride Per Minute by User Type\" ,\n",
    "       x = \"\",\n",
    "       y = \"Average Ride Per Minute\",\n",
    "       fill = \"User Type\")"
   ]
