   "source": [
    "# Average length per Hour by User Type\n",
    "df_clean %>% \n",
    "  #mutate(hour = as.numeric(hour)) %>% \n",
    "  rename(User_Type = \"member_casual\") %>%\n",
    "  group_by(User_Type,hour) %>%\n",
    "  summarise(avg = mean(duration_min)) %>% \n",
    "  ggplot(aes(x = hour, y = avg, group = User_Type, color = User_Type)) +\n",
    "  geom_point(size = 5, alpha = 0.5) +\n",
    "  geom_line(size = 1.5, alpha = 0.8 )+\n",
    "  scale_color_manual(values = c(\"#A07855FF\",\"#FBBC05\")) +\n",
    "  theme_bw()+\n",
    "  theme(legend.position = c(0.15,0.85))+\n",
