   "source": [
    "# Number of Rides per Hour by User Type\n",
    "df_clean %>% \n",
    "   #mutate(hour = as.numeric(hour)) %>% \n",
    "  rename(User_Type = \"member_casual\") %>% \n",
    "  group_by(hour) %>%\n",
    "  count(User_Type) %>% \n",
    "  ggplot(aes(x = hour, y = n, group = User_Type, color = User_Type)) +\n",
    "  geom_point(size = 5, alpha = 0.5) +\n",
    "  geom_line(size = 1.5, alpha = 0.8)+ \n",
    "  scale_color_manual(values = c(\"#A07855FF\",\"#FBBC05\")) +\n",
    "  theme_bw()+\n",
    "  scale_y_continuous(labels = function(x)paste0(x/1000,\"K\"))+\n",
    "  theme(legend.position = c(0.15,0.78))+\n",
    "  theme(text = element_text(size = 16)) +\n",
    "  theme(text = element_text(color = \"black\")) +\n",
    "  theme(axis.text = element_text(size = 12,\n",
    "                                 color = \"black\"))+\n",
    "  labs(title = \"Number of Rides per Hour by User Type\" ,\n",
    "       x = \"\",\n",
    "       y = \"Number of Rides per Hour\")\n",
    "  #transition_reveal(hour)"
   ]
