   "source": [
    "# Total of Rides per Hour thru Week\n",
    "df_clean %>% \n",
    "  group_by(member_casual) %>% \n",
    "   mutate(type_of_weekday = ifelse(\n",
    "     wday == \"Sat\" | wday == \"Sun\",\n",
    "                                   \"weekend\",\n",
    "                                   \"weekday\")) %>% \n",
    "  ggplot(aes(hour, fill = member_casual)) +\n",
    "  geom_bar(position = \"dodge\")+\n",
    "  facet_wrap(~type_of_weekday)+\n",
    "  theme_bw()+\n",
    "  scale_fill_manual(values = c(\"#A07855FF\",\"#FBBC05\")) +\n",
    "  theme(legend.position = \"top\") +\n",
    "  scale_y_continuous(labels = function(x)paste0(x/1000,\"K\"))+\n",
    "  theme(text = element_text(size = 16)) +\n",
    "    theme(strip.background =element_rect(fill=\"black\"))+\n",
    "    theme(strip.text = element_text(colour = 'white', size = 16,face = \"bold\")) +\n",
    "    labs(title = \"Total of Rides per Hour thru Week\",\n",
    "         y = \"Number of Rides\",\n",
    "         x = \"\")+\n",
    "   theme(plot.title = element_text(size = 22,\n",
    "                                  face = \"bold\",\n",
    "                                  color = \"black\",\n",
    "                                  hjust = 0),\n",
    "        axis.text = element_text(size = 12,\n",
    "                                 color = \"black\",\n",
    "                                 face = \"bold\"))"
   ]
