   "source": [
    "# top 10 used stations by casuals \n",
    "\n",
    "df_clean %>% \n",
    "  filter(member_casual=='casual') %>%\n",
    "  group_by(start_station_name) %>%\n",
    "  summarise(count=n()) %>%\n",
    "  arrange(-count) %>%\n",
    "  head(10) %>% \n",
    "  ggplot(aes(x = count , y = reorder(start_station_name, count))) +\n",
    "  geom_col(fill = \"#A07855FF\")+\n",
    "  theme_bw()+\n",
    "  scale_x_continuous(labels = function(x)paste0(x/1000,\"K\"))+\n",
    "  theme(legend.position = \"none\") +\n",
    "  theme(text = element_text(size = 14)) +\n",
    "  theme(text = element_text(color = \"black\")) +\n",
    "  theme(axis.text = element_text(size = 12,\n",
    "                                 color = \"black\"))+\n",
    "  labs(title = \"Top Start Stations by Casual\" ,\n",
    "       x = \"\",\n",
    "       y = \"Station Name\")\n",
    "\n",
    "\n",
    "df_all %>% \n",
    "  drop_na(end_station_name) %>% \n",
    "  filter(member_casual == \"casual\") %>% \n",
    "  group_by(end_station_name) %>% \n",
    "  summarise(count = n()) %>% \n",
    "  arrange(-count) %>% \n",
    "  head(10) %>% \n",
    "  ggplot(aes(x = count , y = reorder(end_station_name, count))) +\n",
    "  geom_col(fill = \"#A07855FF\")+\n",
    "  theme_bw()+\n",
    "  scale_x_continuous(labels = function(x)paste0(x/1000,\"K\"))+\n",
    "  theme(legend.position = \"none\") +\n",
    "  theme(text = element_text(size = 14)) +\n",
    "  theme(text = element_text(color = \"black\")) +\n",
    "  theme(axis.text = element_text(size = 12,\n",
    "                                 color = \"black\"))+\n",
    "  labs(title = \"Top End Stations by Casual\" ,\n",
    "       x = \"\",\n",
    "       y = \"Station Name\")"
   ]
